import React from 'react';
import './IconBar.css';
import YouTubeIcon from '@material-ui/icons/YouTube';
import InstagramIcon from '@material-ui/icons/Instagram';
import FacebookIcon from '@material-ui/icons/Facebook';
import EmailIcon from '@material-ui/icons/Email';
import {ReactComponent as AppleMusicIcon} from '../assets/Apple_Music_Icon_blk.svg';

function IconBar() {
    const styles = {
        icon: {
            color: "black",
            padding: 2,
            width: 30,
            height: 30,
        },
    };

    return (
        <div class="footer">
            <a href="https://www.instagram.com/tangerinerye/">
                <InstagramIcon style={styles.icon} class="icon" /> 
            </a>
            <FacebookIcon style={styles.icon} class="icon" />
            <YouTubeIcon style={styles.icon} class="icon" />
            <EmailIcon style={styles.icon} class="icon" />
            <a href="https://open.spotify.com/artist/6N7HQGSTngvAUUqDquoXfI">
                <Icon className="fa fa-spotify" />
            </a>
            <AppleMusicIcon style={styles.icon} class="icon" />
        </div>
    );
}

export default IconBar;
